export function Navheader() {
  return (
    <div className="nav-header">
      <div className="nav-name">Labidi.</div>
      <div className="nav-links-top">
        <a href="">Home</a>
        <span className="space"></span>
        <a href="">Back</a>
      </div>
    </div>
  );
}

export function Navbottem() {
  return (
    <div className="nav-links-bottom">
      <a href="">Skills</a>
      <a href="">About</a>
      <a href="">Contact</a>
    </div>
  );
}
